import "./App.css";
import ExpenseItem from "./components/ExpenseItem";
function App() {
  return (
    <div className="expense-item ">
      <p>Learn React</p>
      <ExpenseItem></ExpenseItem>
      <div  className="expense-item__description">Jan 16 2001</div>
      <div>
        <h2>Birthday</h2>
        <div >$500</div>
      </div>
    </div>
  );
}

export default App;
